Templates.template:
fireChartDragEnter(
	{
		originEvent: ${originEvent} // object
	}
)

fireChartDragLeave(
	{
		originEvent: ${originEvent}, // object
		draggingSource: ${draggingSource} // object
	}
)

fireGanttChartSwitchRequested(
	{
		hierarchyKey: "${hierarchyKey}" // string
	}
)

fireHorizontalScroll(
	{
		scrollSteps: ${scrollSteps}, // int
		startTime: "${startTime}", // string
		endTime: "${endTime}" // string
	}
)

fireRelationshipSelectionChange(
	{
		originEvent: ${originEvent} // object
	}
)

fireRowSelectionChange(
	{
		originEvent: ${originEvent} // object
	}
)

fireShapeDragEnd(
	{
		originEvent: ${originEvent}, // object
		sourceShapeData: [${sourceShapeData}], // object[]
		sourceSvgId: "${sourceSvgId}", // string
		targetData: ${targetData}, // object
		targetSvgId: "${targetSvgId}" // string
	}
)

fireShapeMouseEnter(
	{
		shapeData: ${shapeData}, // object
		pageX: ${pageX}, // int
		pageY: ${pageY}, // int
		originEvent: ${originEvent} // object
	}
)

fireShapeMouseLeave(
	{
		shapeData: ${shapeData}, // object
		originEvent: ${originEvent} // object
	}
)

fireShapeResizeEnd(
	{
		shapeUid: "${shapeUid}", // string
		rowObject: ${rowObject}, // object
		oldTime: [${oldTime}], // string[]
		newTime: [${newTime}] // string[]
	}
)

fireShapeSelectionChange(
	{
		originEvent: ${originEvent} // object
	}
)

fireSplitterResize(
	{
		id: "${id}", // string
		oldSizes: [${oldSizes}], // int[]
		newSizes: [${newSizes}], // int[]
		zoomInfo: ${zoomInfo} // object
	}
)

fireTreeTableToggleEvent(
	{
		rowIndex: ${rowIndex}, // int
		rowContext: ${rowContext}, // object
		expanded: ${bExpanded} // boolean
	}
)

fireVerticalScroll(
	{
		scrollSteps: ${scrollSteps} // int
	}
)

fireCustomSettingChange(
	{
		id: "${id}", // string
		value: ${bValue} // boolean
	}
)

fireGanttChartChangeRequested(
	{
		action: "${action}", // string
		ganttChartIndex: ${ganttChartIndex}, // int
		hierarchyKey: "${hierarchyKey}", // string
		oldHierarchyKey: "${oldHierarchyKey}", // string
		containerLayoutKey: "${containerLayoutKey}" // string
	}
)

fireTreeTableToggleEvent(
	{
		rowIndex: ${rowIndex}, // int
		rowContext: ${rowContext}, // object
		expanded: ${bExpanded} // boolean
	}
)

fireCheckBoxChange(
	{
		legendType: "${legendType}", // string
		value: ${bValue} // boolean
	}
)

fireDisplayTypeChange(
	{
		displayType: ${displayType} // sap.gantt.simple.GanttChartWithTableDisplayType
	}
)

fireZoomStopChange(
	{
		index: ${index}, // int
		selectedItem: ${selectedItem} // sap.ui.core.Item
	}
)

fireCustomSettingChange(
	{
		name: "${name}", // string
		value: ${bValue} // boolean
	}
)

fireDragStart(
	{
		sourceGanttChart: ${sourceGanttChart}, // sap.gantt.simple.GanttChartWithTable
		draggedShapeDates: ${draggedShapeDates}, // object
		lastDraggedShapeUid: "${lastDraggedShapeUid}", // string
		cursorDateTime: ${cursorDateTime} // object
	}
)

fireShapeConnect(
	{
		fromShapeUid: "${fromShapeUid}", // string
		toShapeUid: "${toShapeUid}", // string
		type: ${type} // sap.gantt.simple.RelationshipType
	}
)

fireShapeContextMenu(
	{
		pageX: ${pageX}, // int
		pageY: ${pageY}, // int
		popoverOffsetX: ${popoverOffsetX}, // int
		rowSettings: ${rowSettings}, // sap.gantt.simple.GanttRowSettings
		shape: ${shape} // sap.gantt.shape.BaseShape
	}
)

fireShapeDoubleClick(
	{
		popoverOffsetX: ${popoverOffsetX}, // int
		rowSettings: ${rowSettings}, // sap.gantt.simple.GanttRowSettings
		shape: ${shape} // sap.gantt.shape.BaseShape
	}
)

fireShapeMouseEnter(
	{
		shape: ${shape}, // sap.gantt.shape.BaseShape
		pageX: ${pageX}, // int
		pageY: ${pageY} // int
	}
)

fireShapeMouseLeave(
	{
		shape: ${shape}, // sap.gantt.shape.BaseShape
		originEvent: ${originEvent} // object
	}
)

fireShapePress(
	{
		popoverOffsetX: ${popoverOffsetX}, // int
		rowSettings: ${rowSettings}, // sap.gantt.simple.GanttRowSettings
		shape: ${shape} // sap.gantt.shape.BaseShape
	}
)

fireShapeResize(
	{
		shapeUid: "${shapeUid}", // string
		shape: ${shape}, // sap.gantt.shape.BaseShape
		rowObject: ${rowObject}, // object
		oldTime: [${oldTime}], // string[]
		newTime: [${newTime}] // string[]
	}
)

fireShapeSelectionChange(
	{
		shapeUids: [${shapeUids}] // string[]
	}
)

fireVisibleHorizonUpdate(
	{
		type: ${type}, // sap.gantt.simple.VisibleHorizonUpdateType
		lastVisibleHorizon: ${lastVisibleHorizon}, // sap.gantt.config.TimeHorizon
		currentVisibleHorizon: ${currentVisibleHorizon} // sap.gantt.config.TimeHorizon
	}
)

fireInteractiveChange(
	{
		legendName: "${legendName}", // string
		value: ${bValue} // boolean
	}
)
